import styled from 'styled-components';

export const Container = styled.div`
  width: 100%;
  height: max-content;
  padding: 50px 0px 0px 50px;
  background: #F7F7F7;
  display: flex;
  flex-direction: column;
`;

export const CarouselContainer = styled.div`
  width: 100%;
  height: max-content;
  display: flex;
  margin-top: 10px;
  border: solid;
`
